import React from 'react';
import Jumbotron from "./components/jumbotron"
import jumboData from "./fixtures/jumbo.json"

function App() {
  return (
    <Jumbotron.Container>
      {jumboData.map((item) => (
        <Jumbotron key={item.id} direction={item.direction}>
          <Jumbotron.Pane>
            <Jumbotron.Title></Jumbotron.Title>
          </Jumbotron.Pane>
        </Jumbotron>
      )) }
    </Jumbotron.Container>

  );
}

export default App;
